import { Layout, Text } from '@ui-kitten/components'
import React from 'react'

export default function Sensor() {
    return (
        <Layout style={{flex:1,alignItems: 'center',justifyContent: 'center'}}>
            <Text>Sensor</Text>
        </Layout>
    )
}
